tables.table_schema:
CREATE TABLE robot_calibration_data (
  robot_id INT,
  calibration_date TIMESTAMP,
  calibration_values JSONB
);

CREATE TABLE calibration_logs ( 
    log_id INT PRIMARY KEY, 
    robot_id INT, 
    log_date TIMESTAMP, 
    log_description TEXT 
);

CREATE TABLE RobotCalibrationData (
    id INT PRIMARY KEY,
    robot_name VARCHAR(255),
    calibration_date DATE,
    calibration_result FLOAT
);

CREATE TABLE RobotCalibrationLogs (
    log_id INT PRIMARY KEY,
    calibration_id INT,
    log_timestamp TIMESTAMP,
    log_message TEXT
);

CREATE TABLE RobotCalibration (
   robot_id INT PRIMARY KEY,
   calibration_date DATE,
   calibration_result BOOLEAN
);

CREATE TABLE RobotParts (
   part_id INT PRIMARY KEY,
   part_name TEXT,
   part_type TEXT
);

CREATE TABLE RobotMaintenance (
   maintenance_id INT PRIMARY KEY,
   robot_id INT,
   maintenance_date DATE,
   maintenance_description TEXT
);

CREATE TABLE RobotLogs (
   log_id INT PRIMARY KEY,
   robot_id INT,
   log_date TIMESTAMP,
   log_message TEXT
);

CREATE TABLE RobotErrors (
   error_id INT PRIMARY KEY,
   robot_id INT,
   error_date TIMESTAMP,
   error_message TEXT
);
